  display: flex;
  align-items: center;
  height: 49px;

  padding: 8px;
  box-shadow: inset 0 -1px 0 0 #dadce0;
}
.header__main .menu__logo {
  display: flex;
  flex-direction: row;
  align-items: center;
  padding: 0px 30px 0px 0px;
  width: 232px;
  max-height: 48px;
}
.menu__logo .menu__icon {
  padding: 12px;
  margin: 0px 4px;
}
.menu__icon .menu__btn {
  padding: 0px 0px;
  border: none;
  cursor: pointer;
  color: #5f6368;
  background: none;
}
.menu__icon:hover {
  border-radius: 50%;
  background: #e2e4e7;
}
.menu__logo .logo__div {
  /* width: 100px; */
  display: flex;
  align-items: center;
  justify-content: center;
}

.logo__div img {
  height: 36px;
  width: 26px;
  margin: 0px 0px 4px;
  padding: 0px 4px 0px 0px;
}
.logo__div span {
  font-family: "Product Sans", Arial, sans-serif;
  font-size: 22px;
  line-height: 24px;
  color: #5f6368;
  filter: contrast(100%);
  padding-left: 18px;
}
.header__main .second__div {
  display: flex;
  flex-direction: row;
  width: 908px;
}
.second__div .search__div {
  display: flex;
  flex-direction: row;
  background: #f1f3f4;
  width: 724px;
  border-radius: 6px;
  margin-right: 60px;
}
.search__div .search__icon {
  color: #5f6368;
  padding: 9px 16px;
}
.search__div .search__input {
  padding: 11px 0px;
  width: 100%;
}

.search__input input {
  padding: 0px;
  border: none;
  outline: none;
  background: none;
  width: 100%;
  font-size: 16px;
  font-weight: 100;
  font-family: Google Sans, Roboto, RobotoDraft, Helvetica, Arial, sans-serif;
  padding-right: 4px;
}

.second__div .icons__div {
  min-width: 150px;
  display: flex;
  flex-direction: row;
  justify-content: space-around;
  align-items: center;
}
.icons__div .icons {
  color: #5f6368;
  height: 48px;
  width: 48px;
  display: flex;
  align-items: center;
  justify-content: center;
}

.header__main .options__div {
  display: flex;
  flex-direction: row;
  justify-content: flex-end;
  width: 124px;
}
.options__div .options {
  padding: 5px;
  font-size: 30px;
  color: #5f6368;
}
.options__div #option2 img {
  height: 32px;
  width: 32px;
  border-radius: 50%;
}
